import React from "react";

class Ninjas extends React.Component{
    render(){
        const {ninjas} = this.props;
        return(
            <div className = "container">
                <div>Name :{ninjas.name}</div>
                <div>Age :{ninjas.age}</div>
                <div>Belt :{ninjas.belt}</div>
            </div>
        )
    }
}

export default Ninjas;
